  `keep_alive` tinyint(1) null default null comment '是否缓存该页面:    1:是   0:不是',
  `hidden` int(2) null default 0 comment '是否隐藏路由: 0否,1是',
  `hide_tab` int(2) null default null comment '是否隐藏tab: 0否,1是',
